import '../Day.css'
const woodlandmenu = "https://order.toasttab.com/online/woodland"

function Day2(){
    return(
        <>
            <h1 className="birthdate-title">April 20</h1>
            <h2>Woodland Brunch <span className="time-title">12:00 pm</span></h2>
            <p>Check menu <a href={ woodlandmenu }>here</a></p>
        </>
    )
}

export default Day2
